                        "value": 800,
                        "clue": "8. Casey wants to replace her organization's MPLS-based external connectivity using commodity technologies. What technology should she select to help her manage this?\nA. IPSec VPN\nB. SASE\nC. SD-WAN\nD. TLS VPN",
                        "solution": "8. C. SD-WAN (software-defined wide area network) is commonly used to replace MPLS (Mul-tiprotocol Label Switching) networks, which are typically higher cost than other connectivity options. IPSec and TLS-based VPNs are used to connect through untrusted networks, but they do not provide the functionality required. SASE uses SD-WAN and other technologies to ensure secure connectivity in complex network infrastructures with endpoints in many locations."
