                        "clue": "11. Michael wants to acquire the firmware from a running device for analysis. What method is most likely to succeed?\nA. Use forensic memory acquisition techniques.\nB. Use disk forensic acquisition techniques.\nC. Remove the firmware chip from the system.\nD. Shut down the system and boot to the firmware to copy it to a removable device.",
                        "solution": "11. A. Firmware can be challenging to access, but both memory forensic techniques and direct hardware interface access are viable means in some cases. Firmware is not typically stored on the disk and instead is stored in a BIOS or UEFI chip. Removing the chip from the system will leave it unable to run and thus this is not a preferred method. Also, many chips are not removable. Shutting down the device and booting it to the firmware does not provide a means of copying the firmware for most devices. Although the firmware is likely to allow updates, most do not allow downloads or copying."
